import React from 'react'
import logo from "../assets/b12be635ae36fcc3fa7dc828d3dd01f8.png"
import {Link} from "react-router-dom"

const Navbar = () => {
  return (
    <div>

        <Link to="/">
            <img src={logo}/>
        </Link>
    </div>
  )
}

export default Navbar
